description:
Get the best music experience on your Android phone or tablet with Music Player Pro Free app. Designed to give you best music experience.

Features:
1. Play in Most of Android Mobile and Tablets. Supports Android Lollipop
2. Simple and elegant music player for Android.
3. Collect All songs from mobile and play with single click.
4. Quick access from notification bar.
5. Best sound quality.
6. Support Major formats: MP3, MP2, MP1, OGG, WAV, AIFF, MIDI, AAC, AAC , 3GP, XM, IT, S3M, MOD, MTM, UMX, MO3, MP4, M4A, OTA
7. Lock Screen Widget
8. It's free! This app is completely free for you.

